from measure import measure


class Solution:
    def findDisappearedNumbers(self, nums: List[int]) -> List[int]:
        missingNumbers = []
        size = len(nums)
        for i in range(size):
            idx = abs(nums[i]) - 1
            if nums[ idx ] > 0:
                nums[ idx ] = -nums[ idx ]

        for i in range(size):
            if (nums[i] > 0):
                missingNumbers.append(i + 1)
        return missingNumbers

